import { useTranslation } from "react-i18next";
import Card from "./Card/Card";
const Cards = () => {
    const { t, i18n } = useTranslation();
    return(
        <div className="wrap">
           <Card data={{room: t("room1"), floor: t("floor1")}}/>
        </div>
    )
}
export default Cards;
